dad 11 litros. Polyester 600D Snow: resistente al agua. Mochila con detalle en símil cuero en la parte inferior.  Dos bolsillos externos, uno superior y otro en el costado izquierdo. Dos compartimentos, el principal con porta laptop acolchado, porta tablet y un bolsillo pequeño. El segundo compartimento tiene dos bolsillos, dos porta bolígrafos y dos bolsillos de red. Correas acolchadas. Los tiradores de cierre son de símil cuero. El bolsillo del costado izquierdo cuenta con el forro desmontable para que en caso de personalizar el producto con bordado no se vea afectado dicho bolsillo. El bolsillo superior tiene un bolsillo pequeño con cierre para facilitar la entrada de la máquina bordadora.\r\n\r\nTamaño: 41 x 29 x 10 cm.',0,1,'2020-08-31 22:54:47','2020-08-31 22:54:47',NULL,'[\"products%2Fmigrated%2FMOCHILA-_FORT_-1_3.jpg\",\"products%2Fmigrated%2FMOCHILA-_FORT_-2_2.jpg\",\"products%2Fmigrated%2FMOCHILA-_FORT_-3_2.jpg\",\"products%2Fmigrated%2FMOCHILA-_FORT_-4_2.jpg\",\"products%2Fmigrated%2FMOCHILA-_FORT_-5_2.jpg\"]','ST-C531',0,'mochila-fort'),(1301,'Mochila \"Catania\"','','Polyester. Capacidad 25 Lt. Mochila con bolsillo interno acolchado y porta notebook de hasta 15”. En el exterior un bolsillo pequeño y otro grande con cierre que en su interior cuenta con tres compartimentos y en sus extremos dos bolsillos de red. Tiradores de goma con detalles de color. Correas acolchadas regulables.\r\n\r\nTamaño: 47 x 32 x 17 cm.',0,1,'2020-08-31 22:54:47','2020-08-31 22:54:47',NULL,'[\"products%2Fmigrated%2FMOCHILA-_CATANIA_-1_3.jpg\",\"products%2Fmigrated%2FMOCHILA-_CATANIA_-2_2.jpg\",\"products%2Fmigrated%2FMOCHILA-_CATANIA_-3_2.jpg\",\"products%2Fmigrated%2FMOCHILA-_CATANIA_-4_2.jpg\",\"products%2Fmigrated%2FMOCHILA-_CATANIA_-5_2.jpg\",\"products%2Fmigrated%2FMOCHILA-_CATANIA_-6_2.jpg\",\"products%2Fmigrated%2FMOCHILA-_CATANIA_-7_2.jpg\"]','ST-C516',0,'mochila-catania'),(1302,'Colgador de Carteras Sublimación','','Colgador Metálico redondo de sobremesa, para Bolsos y