ank Woding','','<!-- wp:paragraph -->\n<p>Con cargador inalámbrico integrado de 4.000 mAh de capacidad de carga. Salida USB, con cable de carga micro USB incluido. Compatible con dispositivos equipados con tecnología de carga inalámbrica. Con baterías de grado A y no recicladas, con una vida útil de al menos 500 ciclos de carga y según normativa CE. Además, están fabricadas conforme a los estándares RoHS y en cumplimiento con los requisitos de seguridad.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:57','2020-08-31 22:54:57',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-7_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-7_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-7_4.jpg\"]','MKT-6272',1,'power-bank-woding'),(1447,'Mochila Antirrobo Komplete','','<!-- wp:paragraph -->\n<p>Mochila antirrobo en resistente material poliéster 300D, con bolsillo antirrobo en la espalda. Compartimento interior con salida USB para conexión de powerbank -no incluido-. Incluye cable micro USB, bolsillo en lateral con protección RFID y compartimentos interiores acolchados para tablets de hasta 10 pulgadas y portátiles de hasta 15 pulgadas. Cinta para fijación al trolley. Cintas de hombros y espalda ajustables con acolchado.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:57','2020-08-31 22:54:57',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-8_6.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-8_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-8_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-7_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-3_4.jpg\"]','MKT-6345',1,'mochila-antirrobo-komplete'),(1448,'Bolígrafo Valvek','','<!-- wp:paragraph -->\n<p>Bolígrafo de línea nature en cartón reciclado y original capucha a juego. Con tinta azul y disponible en variada gama de colores nature.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:57','2020-08-31 22:54:57',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-9_3.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-9_4.jpg