13_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-13_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-13_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-10_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-6_4.jpg\"]','MKT-2674',0,'luz-reflectante-tinax'),(1452,'Organizador Cargador Merson','','<!-- wp:paragraph -->\n<p>Elegante y práctico organizador cargador en polipiel. Cargador inalámbrico integrado con luz indicadora de carga y ajustable a cualquier tamaño de bloc de notas. Incluye soporte para bolígrafo y multitud de bolsillos para tarjetas y otros accesorios. Disponible en variada gama de colores, con cierre de corchete y bandas elásticas. Cable micro USB incluido.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:57','2020-08-31 22:54:57',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-14_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-14_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-14_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-11_4.jpg\"]','MKT-6326',1,'organizador-cargador-merson'),(1453,'Tablet Escritura LCD Koptul','','<!-- wp:paragraph -->\n<p>Tableta LCD para   escritura en resistente material, con fijación magnética. Pantalla LCD de 8,5   pulgadas, con lápiz incluido, botón de borrado y bloqueo anti borrado.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:57','2020-08-31 22:54:57',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-15_6.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-15_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-15_4.jpg\"]','MKT-6247',1,'tablet-escritura-lcd-koptul'),(1454,'Protector Soporte Sernel','','<!-- wp:paragraph -->\n<p>Práctico protector soporte 4 en 1, compatible con todos los modelos de smartphone. En resistente silicona y ABS, con función de paragolpes, anillo 360º para selfies, tarjetero y soporte. Disponible en variada gama de colores.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:57','2020-08-31 22:54:57',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-16_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-12_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-7_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-16_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-16_4.jpg\"]','MKT-6304',1,'protector-soporte-sernel'),(1455,'Bolígrafo Tinzo','','<!-- wp:paragraph -->\n<p>Bolígrafo de línea nature en material RPET, elaborado a partir de plástico reciclado, para así fomentar la reutilización de residuos plásticos y ayudar a la sostenibilidad del planeta. De acabo transparente y con clip especialmente diseñado para marcaje en tampografía. De mecanismo pulsador, cartucho jumbo y con tinta azul.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:57','2020-08-31 22:54:57',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-17_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-17_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-17_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-13_4.jpg\"]','MKT-6330',1,'boligrafo-tinzo'),(1456,'Linterna Vilox','','<!-- wp:paragraph -->\n<p>Linterna de línea deportiva con cinta elástica ajustable para brazo, cabeza… Con 8 luces COB blancas y 3 posiciones de iluminación (2 posiciones fijas y 1 posición intermitente). Disponible en variada gama de colores, con alimentación a pilas (3xAAA no incluidas) y presentada en una atractiva caja de diseño.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:58','2020-08-31 22:54:58',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-18_6.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-18_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-18_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-14_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-8_4.jpg\"]','MKT-6246',0,'linterna-vilox'),(1457,'Bolígrafo Puntero Parlex','','<!-- wp:paragraph -->\n<p>Bolígrafo puntero de mecanismo pulsador y original diseño. Acabado en variada gama de colores brillantes, con accesorios cromados y clip metálico. De cartucho jumbo y tinta azul.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:58','2020-08-31 22:54:58',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-19_6.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-19_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-15_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-19_5.jpg\"]','MKT-6346',1,'boligrafo-puntero-parlex'),(1458,'Bolígrafo Rosdy','','<!-- wp:paragraph -->\n<p>Bolígrafo de línea nature en combinación de materiales fibra de trigo y ABS, para así fomentar la utilización de materias primas naturales y reducir las emisiones contaminantes. Con empuñadura a juego, de mecanismo pulsador y con tinta azul. Disponible en variada gama de colores nature.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:58','2020-08-31 22:54:58',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-20_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-20_4.jpg\"]','MKT-6334',0,'boligrafo-rosdy'),(1459,'bolsa kaiso','','<!-- wp:paragraph -->\n<p>Bolsa de línea nature en material RPET, elaborado a partir de plástico reciclado, para así fomentar la reutilización de residuos plásticos y ayudar a la sostenibilidad del planeta. En material laminado de 100 g/m2 de acabado mate, con asas medianas y costuras y base reforzadas. Resistencia hasta 10-12 kg de peso. Disponible en variada gama de colores, con etiqueta distintivo RPET.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:58','2020-08-31 22:54:58',NULL,'[\"products%2Fmigrated%2Fbolsa-kaiso_3.jpg\",\"products%2Fmigrated%2F2_7.jpg\"]','MKT-6341',0,'bolsa-kaiso'),(1460,'Pajita Parix','','<!-- wp:paragraph -->\n<p>Pajita de silicona flexible y reutilizable, de 25,5cm de largo. Disponible en variada gama de colores brillantes y presentada en estuche de PP con acabado translúcido.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:58','2020-08-31 22:54:58',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-21_6.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-16_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-20_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-21_4.jpg\"]','MKT-6291',1,'pajita-parix'),(1461,'Bolígrafo Clessin','','<!-- wp:paragraph -->\n<p>Bolígrafo 4 en 1 de mecanismo pulsador retráctil, de clásico diseño y cuerpo de suave acabado sólido en color blanco. Suave empuñadura a juego en vivos colores. De 4 cartuchos, en tintas azul, negra, roja y verde.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:58','2020-08-31 22:54:58',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-9_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-22_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-22_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-21_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-17_5.jpg\"]','MKT-6336',1,'boligrafo-clessin'),(1462,'Set Pajitas Lantux','','<!-- wp:paragraph -->\n<p>Set de pajitas de papel con tratamiento especial anti humedad. Compuesto por 10 pajitas, presentadas en estuche de cartón reciclado. Disponible en acabado natural y marrón.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:58','2020-08-31 22:54:58',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-23_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-18_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-23_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-22_5.jpg\"]','MKT-6290',0,'set-pajitas-lantux'),(1463,'Bidón Terkol','','<!-- wp:paragraph -->\n<p>Bidón de cristal en alta calidad, de 500ml de capacidad, con cuerpo de acabado transparente en material libre de BPA y tapón a rosca en acero inox. Disponible en variada gama de colores. Presentado en atractiva caja de diseño.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:58','2020-08-31 22:54:58',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-24_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-19_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-10_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-24_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-23_4.jpg\"]','MKT-6314',1,'bidon-terkol'),(1464,'Tarjetero Soporte Tisson','','<!-- wp:paragraph -->\n<p>Tarjetero con sporte para smartphone. En materiales ABS