po en plástico ABS, de tamaño compacto y portable. Con mosquetón a juego de transporte, conexiones micro USB, Tipo C y Lightning. En elegante color negro, con luz led interior y un recubrimiento exterior especialmente diseñado para marcaje en láser, con el que conseguirá que su publicidad o marca quede iluminada con luz blanca. Presentado en bolsa auto cierre de diseño.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:59','2020-08-31 22:54:59',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-14_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-32_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-31_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-29_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-24_4.jpg\"]','MKT-6303',1,'cargador-gatil'),(1472,'Fiambrera Sandwich Dredon','','<!-- wp:paragraph -->\n<p>Fiambrera sandwich de línea nature en combinación de materiales fibra de bambú y PP libre de BPA, para así fomentar la utilización de materias primas naturales y reducir las emisiones contaminantes. De 450 ml de capacidad, con tapa extraíble.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:59','2020-08-31 22:54:59',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-30_6.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-33_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-32_4.jpg\"]','MKT-6294',0,'fiambrera-sandwich-dredon'),(1473,'Vela Deram','','<!-- wp:paragraph -->\n<p>Vela de navidad de madera de pino con originales diseños de estrella y arbolito. Presentada en cajita blanca individual.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:59','2020-08-31 22:54:59',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-31_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-34_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-33_4.jpg\"]','MKT-6279',0,'vela-deram'),(1474,'Bidón Suduk','','<!-- wp:paragraph -->\n<p>Bidón en alta calidad de 550ml de capacidad, con cuerpo de acabado transparente en material tritán, de resistencia al calor (hasta 95º C) y libre de BPA. Tapón