n madera natural.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:59','2020-08-31 22:54:59',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-17_3.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-43_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-42_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-40_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-33_4.jpg\"]','MKT-6275',1,'posavasos-palet'),(1482,'Adorno Vondix','','<!-- wp:paragraph -->\n<p>Adorno navideño en pizarra, con lacito para colgar y en elegantes diseños árbol de navidad y estrella.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:59','2020-08-31 22:54:59',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-44_6.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-43_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-41_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-34_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-18_2.jpg\"]','MKT-6349',0,'adorno-vondix'),(1483,'Tapón Luz Lupok','','<!-- wp:paragraph -->\n<p>Original tapón de luz para decoración de botellas. Cable con 10 luces LED blancas y posición fija. Alimentación a pilas (de botón incluidas), con botón ON/OFF y presentado en atractiva caja de diseño.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:59','2020-08-31 22:54:59',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-19_3.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-45_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-44_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-42_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-35_2.jpg\"]','MKT-6249',1,'tapon-luz-lupok'),(1484,'Paraguas Bonaf','','<!-- wp:paragraph -->\n<p>Paraguas de línea   nature de 105cm de diámetro. En material pongee 190T RPET, elaborado a partir   de plástico reciclado, para así fomentar la reutilización de residuos   plásticos y ayudar a la sostenibilidad del planeta. De apertura automática y   varillas metálicas. Mango y caña de madera, con etiqueta distintiva RPET</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:54:59','2020-08-31 22:54:59',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-46_6.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-45_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-43_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-36_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-20_2.jpg\"]','MKT-6316',0,'paraguas-bonaf'),(1485,'Adorno Luzox','','<!-- wp:paragraph -->\n<p>Original adorno botellita con cuerpo transparente, con iluminación interior en motivos navideños. Con botón ON/OFF y cinta para colgar. Alimentación a pilas (de botón incluidas).</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:00','2020-08-31 22:55:00',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-44_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-47_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-46_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-37_2.jpg\"]','MKT-6318',0,'adorno-luzox'),(1486,'Brazalete Inteligente Ragol','','<!-- wp:paragraph -->\n<p>Brazalete inteligente multifunción de diseño deportivo, con conexión Bluetooth® 4.0 y recargable mediante conector micro USB. Su cuerpo en material TPU y su pantalla a color TFT integrada de 0,96 pulgadas lo convierten en el gadget perfecto para actividades deportivas, de ocio y para el día a día. APP disponible para iOS y Android. Con monitorización de frecuencia cardíaca y multitud de funciones.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:00','2020-08-31 22:55:00',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-48_6.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-38_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-21_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-45_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-47_4.jpg\"]','MKT-6351',1,'brazalete-inteligente-ragol'),(1487,'Cargador Sakrol','','<!-- wp:paragraph -->\n<p>Cargador inalámbrico de innovador diseño con ventosas y con función soporte de smartphone. De diseño monocolor en blanco, con cable de carga micro USB incluido. Compatible con dispositivos equi