nalámbrica de 3.000 mAh. Salida dual USB. Cable de carga micro USB, base antideslizante y con carga inalámbrica, según normativa CE. Fabricadas segun estándares RoHS, Requisitos de seguridad: Protección contra sobrecarga. Protección contra descarga completa. Bloqueo para evitar cortocircuitos. Transferencia de carga constante.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:00','2020-08-31 22:55:00',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-23_3.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-52_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-51_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-49_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-42_2.jpg\"]','MKT-6267',0,'power-bank-vendrel'),(1491,'Lámpara Demil','','<!-- wp:paragraph -->\n<p>Potente lámpara plegable para los más aventureros. En resistente material de acabado brillante, incluye 30 luces LED en 3 tiras COB. Tono de iluminación blanco, con prácticas asas metálicas para el transporte. Alimentación a pilas (3xAAA no incluidas) y presentada en atractiva caja de diseño.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:00','2020-08-31 22:55:00',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-24_3.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-53_4.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-52_5.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-50_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-43_2.jpg\"]','MKT-6250',0,'lampara-demil'),(1492,'Cargador Zafren','','<!-- wp:paragraph -->\n<p>Cargador inalámbrico con función soporte de smartphone. De sobrio diseño monocolor en blanco, con cable de carga micro USB incluido. Compatible con dispositivos equipados con tecnología de carga inalámbrica. Presentado en atractiva caja de diseño.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:00','2020-08-31 22:55:00',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-25_3.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-54_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-51_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-53_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-44_2.jpg\"]','MKT-6260',0,'cargador-zafren'),(1493,'Altavoz Garbo','','<!-- wp:paragraph -->\n<p>Altavoz de conexión Bluetooth® de diseño bicolor, con rejilla en color blanco y asa de transporte. Con conexión Bluetooth® 4.2, ofrece 3W de potencia, tiene función de manos libres, reproductor USB, ranura para tarjetas micro SD y función radio FM. Entrada auxiliar de línea mediante conexión micro USB a jack de 3,5mm y base antideslizante. Compatible con iOS y Android, incluye cable de carga micro USB. Presentado en atractiva caja de diseño.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:00','2020-08-31 22:55:00',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-55_3.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-52_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-45_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-54_2.jpg\"]','MKT-6301',1,'altavoz-garbo'),(1494,'Cargador Devel','','<!-- wp:paragraph -->\n<p>Cargador inalámbrico de diseño circular bicolor con base en poliéster. Con salida USB, cable de carga micro USB, base antideslizante y compatible con dispositivos equipados con tecnología de carga inalámbrica. Presentado en atractiva caja de diseño.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:00','2020-08-31 22:55:00',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-46_3.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-55_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-56_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-53_2.jpg\"]','MKT-6256',0,'cargador-devel'),(1495,'Power Bank Kustol','','<!-- wp:paragraph -->\n<p>Batería auxiliar externa de 4.000 mAh. Con luz led interior, diseñado para marcaje en láser. Indicador de estado de carga, con salida USB y entrada micro USB -cable incluido-. Con una vida útil de al menos 500 ciclos de carga y según normativa CE. Además, están fabricadas conforme a los estándares RoHS. Cumple con requisitos de seguridad: Sistema de protección contra sobrecarga, descarga completa, evita cortocircuitos y Carga constante.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:00','2020-08-31 22:55:00',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-56_3.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-57_2.jpg\"]','MKT-6271',0,'power-bank-kustol'),(1496,'Power Bank Kendrix','','<!-- wp:paragraph -->\n<p>Batería auxiliar externa con cargador inalámbrico integrado. 5.000 mAh de capacidad de carga, con anilla de transporte, Salida USB, con cable de carga micro USB incluido. Compatible con dispositivos equipados con tecnología de carga inalámbrica. baterías de grado A y no recicladas, con una vida útil de al menos 500 ciclos de carga y según normativa CE. Además, están fabricadas conforme a los estándares RoHS.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:00','2020-08-31 22:55:00',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-26_3.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-54_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-57_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-47_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-58_2.jpg\"]','MKT-6261',0,'power-bank-kendrix'),(1497,'Carpeta Cargador Porem','','<!-- wp:paragraph -->\n<p>Carpeta con base de carga inalámbrica. En suave polipiel y poliéster 300D de acabado grafito, de sobrio diseño y con base de carga inalámbrica en portada, multitud de compartimentos para almacenar tarjetas de visita y memorias USB, además de un soporte para smartphone o tablet. Incluye bloc de notas extraíble de 40 hojas a una raya, tamaño A4.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:00','2020-08-31 22:55:00',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-59_3.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-58_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-55_2.jpg\"]','MKT-6328',1,'carpeta-cargador-porem'),(1498,'Cubitera Altavoz Trobel','','<!-- wp:paragraph -->\n<p>Original cubitera con potente altavoz integrado en la base. En resistente material de acabado translúcido y con conexión Bluetooth® 5.0, ofrece unos más que respetables 5W de potencia. Con iluminación inteligente LED en el interior que sigue el ritmo de la música. Recargable mediante cable micro USB (incluido) y presentada en atractiva caja de diseño.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:00','2020-08-31 22:55:00',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-60_3.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-27_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-56_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-48_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-59_2.jpg\"]','MKT-6255',0,'cubitera-altavoz-trobel'),(1499,'Alfombrilla Calendario Rendux','','<!-- wp:paragraph -->\n<p>Alfombrilla   calendario en variados colores y de suave acabado en PVC. Diseño mes en   curso/mes anterior/mes siguiente. Base acolchada antideslizante.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:00','2020-08-31 22:55:00',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-61_3.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-60_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-57_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-49_2.jpg\"]','MKT-3892',1,'alfombrilla-calendario-rendux'),(1500,'Power Bank Lenard','','<!-- wp:paragraph -->\n<p>Batería auxiliar externa de recarga solar, resistente a las salpicaduras de agua y de gran capacidad de carga -4.000 mAh-. Especialmente diseñada para actividades al aire libre en las que no hay posibilidad de acceso a una fuente de recarga eléctrica. Dispone   de salida USB dual para cargar dos dispositivos simultáneamente.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:00','2020-08-31 22:55:00',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-62_3.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-61_2.jpg\"]','MKT-4939',0,'power-bank-lenard'),(1501,'Vela Nettax','','<!-- wp:paragraph -->\n<p>Original vela   aromática en recipiente de cristal de vivos colores y variadas fragancias.   Disponible en aromas c