suave   acabado. Con clip plano a juego y bola de nieve impresa en parte superior.   Tinta azul.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:04','2020-08-31 22:55:04',NULL,'[\"products%2Fmigrated%2Fboligrafo-yule_3.jpg\"]','MKT-4067',0,'boligrafo-yule'),(1555,'Multiherramienta Chapix','','<!-- wp:paragraph -->\n<p>Llavero   multiherramienta con cuerpo de aluminio en variados y vivos colores. Con 3   destornilladores y especialmente diseñado para marcaje en láser.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:04','2020-08-31 22:55:04',NULL,'[\"products%2Fmigrated%2Fmultiherramienta-chapix_3.jpg\"]','MKT-4983',0,'multiherramienta-chapix'),(1556,'Tapones Panoss','','<!-- wp:paragraph -->\n<p>Confortables tapones   para oídos en confortable material EVA de vivos colores. Presentados en   estuche individual transparente con cadenita de transporte</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:04','2020-08-31 22:55:04',NULL,'[\"products%2Fmigrated%2F2-1_3.jpg\",\"products%2Fmigrated%2Ftapones-panoss_2.jpg\",\"products%2Fmigrated%2F3-2_2.jpg\",\"products%2Fmigrated%2F4-2_2.jpg\",\"products%2Fmigrated%2F5-1_2.jpg\"]','MKT-4677',1,'tapones-panoss'),(1557,'Audífonos Merkus','','<!-- wp:paragraph -->\n<p>Auriculares   intraurales de conexión Bluetooth® 5.0 y diseño minimalista en elegante color   blanco. De diseño ergonómico, incluyen panel de control integrado en en   auricular, con estuche y base de carga a juego. Función manos libres y   recargables, con cable micro USB incluido. Presentados en estuche individual   de lujo con tapa transparente de bisagra. Presentados en atractiva caja de   diseño.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:04','2020-08-31 22:55:04',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-116_3.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-72_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-45_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-110_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-91_2.jpg\"]','MKT-6257',1,'audifonos-merkus'),(1558,'Power Bank Tikur','','<!-- wp:paragraph -->\n<p>Tecnología de carga inalámbrica de 4.000 mAh. Resistente aluminio, con salida USB y cable de carga micro USB. Indicador de  estado de carga y compatible con dispositivos de carga inalámbrica. Con estándares RoHS y en cumplimiento con los requisitos de seguridad: Sistema de protección contra sobrecarga, contra descarga completa, sistema de bloqueo que evita cortocircuitos y sistema de transferencia de carga constante.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:04','2020-08-31 22:55:04',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-111_3.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-46_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-73_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-92_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-117_2.jpg\"]','MKT-6263',0,'power-bank-tikur'),(1559,'Reloj Cargador Dolbix','','<!-- wp:paragraph -->\n<p>Reloj de   línea nature con cargador inalámbrico integrado. En madera natural, con   función fecha y hora, alarma y termómetro. 3 posiciones de iluminación, con   cable micro USB incluido y compatible con dispositivos equipados con   tecnología de carga inalámbrica. Presentado en atractiva caja de diseño.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:04','2020-08-31 22:55:04',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-112_3.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-93_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-74_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-118_2.jpg\"]','MKT-6264',1,'reloj-cargador-dolbix'),(1560,'Humidificador Paffil','','<!-- wp:paragraph -->\n<p>Elegante y   decorativo humidificador con original diseño, disponible en acabado blanco y   difuminado. Con suave tacto de goma y luz led blanca en el interior. 250ml de   capacidad, con botón de encendido ON/OFF. Recomendado para uso en estancias   de hasta 25m2, con 3 filtros de recambio y cable de alimentación USB   (incluido). Presentado en bandeja protectora de PVC y en atractiva caja de   diseño.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:04','2020-08-31 22:55:04',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-113_3.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-75_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-119_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-47_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-94_2.jpg\"]','MKT-6265',0,'humidificador-paffil'),(1561,'Lámpara Multifunción Lerex','','<!-- wp:paragraph -->\n<p>Lámpara   multifunción todo en uno en acabado blanco, con altavoz Bluetooth® 4.2 de 3W   de potencia y cargador inalámbrico integrados. 14 LEDs y 3 posiciones de   iluminación (cálida, fría y media), ajustable en altura. Compatible con   dispositivos móviles de carga inalámbrica, con cable cargador micro USB y   viene presentada en una atractiva caja de diseño.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:04','2020-08-31 22:55:04',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-48_3.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-114_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-2-120_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-76_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-3-95_2.jpg\"]','MKT-6268',0,'lampara-multifuncion-lerex'),(1562,'Altavoz Baran','','<!-- wp:paragraph -->\n<p>Altavoz de conexión Bluetooth® de diseño monocromático, con rejilla de poliéster y asa de transporte a juego en silicona. Con conexión Bluetooth® 5.0, ofrece 3W de potencia, tiene función de manos libres y función radio FM. Entrada auxiliar de línea mediante conexión jack de 3,5mm, compatible con iOS y Android. Incluye cable de carga micro USB, cable auxiliar jack de 3,5mm y además está   disponible en una extensa gama de colores.</p>\n<!-- /wp:paragraph -->',0,1,'2020-08-31 22:55:05','2020-08-31 22:55:05',NULL,'[\"products%2Fmigrated%2FSin-t%C3%ADtulo-1-115_3.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-4-77_2.jpg\",\"products%2Fmigrated%2FSin-t%C3%ADtulo-5-49_2.jpg\",\"